import React from 'react'

const SKILLS = [ "HTML", "CSS", "JAVASCRIPT", "REACT", "DATE-FNS", "JIRA", "CONFLUENCE", "GIT", "GITHUB", "VISUAL STUDIO CODE", "STORYBOOK", "JENKINS", "LUCID CHART", "ZOOM"
];



const Skills = () => {
  return (
    <div className="skillsContainer">
    <ul>
    <h1>SKILLS</h1>
      {SKILLS.map((skill, index) => (
        <li key={index}>{skill}</li>
      ))}
    </ul>
  </div>
)};

export default Skills
